#sum of absolute difference between indices
#with the same value
def getDistances(arr):
  ret = [0] * len(arr)
  L = {}
  for i in range(len(arr)):
    if arr[i] in L:
      L[arr[i]] += [i]
    else:  
      L[arr[i]] = L.setdefault(arr[i],[]) + [i]

  for key in L:
    ml = L[key]
    pre = [0] * (len(ml)+1)
    for i in range(len(ml)):
      pre[i+1] = pre[i] + ml[i]

    for index, val in enumerate(ml):
      a = (val * index - pre[index])
      b = ((pre[-1] - pre[index]) - val * (len(ml)-index))
      ret[val] = a + b

  return ret





